import { useEffect } from 'react';


const SocialLogin = () =>{
    const sendCode = () => {
        let url = new URL(window.location.href);
        console.log(url);
    }
    useEffect(sendCode);
    return(
        <div>
            <h1>처리중입니다.</h1>
        </div>
    );
}

export default SocialLogin;
